<script>
    document.addEventListener('DOMContentLoaded', function() {
        const currentUrl = window.location.href;
        const currentPath = window.location.pathname;

        const navItems = document.querySelectorAll('.nav-items');
        const servicesBtn = document.getElementById('services-btn');
        const technologyBtn = document.getElementById('technology-btn');
        const dropdownWrapper = document.querySelector('.header-dropdown-wrapper');
        const rightPart = document.querySelector('.right-part');

        // Remove active class from all nav items first
        navItems.forEach(item => item.classList.remove('active'));

        // ✅ Set active class on load based on URL
        function setActiveNavItem() {
            navItems.forEach(item => {
                const link = item.querySelector('a');
                if (link) {
                    const linkHref = link.getAttribute('href');

                    if (currentUrl === linkHref || currentPath === new URL(linkHref, location.origin).pathname) {
                        item.classList.add('active');
                    }

                    if (currentPath === '/' && (linkHref.includes('home') || linkHref === '<?php echo home_url("/"); ?>')) {
                        item.classList.add('active');
                    }

                    if (linkHref.includes('/services/') && currentPath.includes('/services/')) {
                        item.classList.add('active');
                    }
                    if (linkHref.includes('/technology/') && currentPath.includes('/technology/')) {
                        item.classList.add('active');
                    }
                    if (linkHref.includes('/expertise/') && currentPath.includes('/expertise-page/')) {
                        item.classList.add('active');
                    }
                    if (linkHref.includes('/about-us/') && currentPath.includes('/about-us/')) {
                        item.classList.add('active');
                    }
                }
            });
        }

        setActiveNavItem(); // Call on load

        // ✅ Open Services Dropdown
        if (servicesBtn) {
            servicesBtn.addEventListener('click', function(e) {
                e.preventDefault();

                // Show only Services list
                if (rightPart) {
                    const allLists = rightPart.querySelectorAll('.dropdown-list');
                    allLists.forEach(list => list.style.display = 'none');

                    const servicesList = rightPart.querySelector('.services-list');
                    if (servicesList) servicesList.style.display = 'block';
                }

                // Toggle dropdown visibility
                dropdownWrapper.classList.toggle('active');

                // Set nav state
                navItems.forEach(nav => nav.classList.remove('nav-active'));
                servicesBtn.classList.add('nav-active');
            });
        }

        // ✅ Open Technology Dropdown
        if (technologyBtn) {
            technologyBtn.addEventListener('click', function(e) {
                e.preventDefault();

                // Show only Technology list
                if (rightPart) {
                    const allLists = rightPart.querySelectorAll('.dropdown-list');
                    allLists.forEach(list => list.style.display = 'none');

                    const techList = rightPart.querySelector('.technology-list');
                    if (techList) techList.style.display = 'block';
                }

                // Toggle dropdown
                dropdownWrapper.classList.toggle('active');

                // Set nav state
                navItems.forEach(nav => nav.classList.remove('nav-active'));
                technologyBtn.classList.add('nav-active');
            });
        }

        // ✅ Close dropdown on click outside
        document.addEventListener('click', function(e) {
            const isClickInsideDropdown = dropdownWrapper && dropdownWrapper.contains(e.target);
            const isClickOnService = servicesBtn && servicesBtn.contains(e.target);
            const isClickOnTech = technologyBtn && technologyBtn.contains(e.target);

            if (!isClickInsideDropdown && !isClickOnService && !isClickOnTech) {
                dropdownWrapper.classList.remove('active');
                navItems.forEach(nav => nav.classList.remove('nav-active'));
            }
        });

        // ✅ Set nav active class for other links
        navItems.forEach(item => {
            const link = item.querySelector('a');
            if (!link) return;

            // Skip service/technology buttons
            // if (item.id === 'services-btn' || item.id === 'technology-btn') return;

            link.addEventListener('click', function() {
                navItems.forEach(nav => {
                    nav.classList.remove('active');
                    nav.classList.remove('nav-active');
                });

                item.classList.add('active');

                // Close dropdown if open
                dropdownWrapper.classList.remove('active');
            });
        });
    });
</script>

